import React from 'react';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';
import MemberForm from './components/MemberForm';
import EventForm from './components/EventForm';
import './App.css';

function App() {
    return (
        <Router>
            <div className="App">
                <nav>
                    <ul>
                        <li><Link to="/">Home</Link></li>
                        <li><Link to="/members">Register Member</Link></li>
                        <li><Link to="/events">Create Event</Link></li>
                    </ul>
                </nav>
                <Switch>
                    <Route path="/members">
                        <MemberForm />
                    </Route>
                    <Route path="/events">
                        <EventForm />
                    </Route>
                    <Route path="/">
                        <h2>Welcome to the Sports Association Management</h2>
                    </Route>
                </Switch>
            </div>
        </Router>
    );
}

export default App;
